INSERT INTO `wp_postmeta` VALUES (13,8,'_edit_last','1'),(14,8,'_edit_lock','1549500499:1'),(60,30,'_edit_last','36'),(61,30,'_edit_lock','1549044484:36'),(203,65,'_edit_last','36'),(204,65,'_wp_page_template','pages/enter.php'),(205,65,'_edit_lock','1549037462:36'),(206,68,'_edit_last','1'),(207,68,'_edit_lock','1547140905:1'),(208,68,'_wp_page_template','pages/dashboard.php'),(221,70,'_edit_last','1'),(222,70,'_edit_lock','1548430911:36'),(225,75,'_edit_last','36'),(226,75,'_edit_lock','1549015932:36'),(227,77,'_edit_last','1'),(228,77,'_edit_lock','1546174799:1'),(304,87,'_edit_last','36'),(305,87,'_edit_lock','1549016077:36'),(306,89,'_edit_lock','1548422352:36'),(307,89,'_edit_last','36'),(308,91,'_edit_lock','1549037439:36'),(309,91,'_edit_last','36'),(310,87,'page_intro','The SPASA Awards of Excellence celebrate the outstanding achievements of members across all sectors and offer the opportunity to showcase accomplishments in construction, design, manufacturing and service.'),(311,87,'_page_intro','field_5c07f58463562'),(312,87,'page_content','<h2>All entries into the Awards of Excellence are judged independently by an expert panel comprising of representatives from various industry associated third parties.</h2>\r\nAward entries, images and payment must be received by close date. Due to judging dates, no entries will be accepted after.\r\n\r\nEntries are judged based on criteria set out in each category and will be scored out of 100 with the three highest scores being awarded Gold or Highly Recommended.\r\n\r\nThere will be no correspondence between judges throughout this process as judging is conducted online.\r\n\r\nEntries in applicable categories will have all identifying information removed prior to judging.\r\n\r\nNo information in relation to winners or entrants is made available to the SPASA Board, local committees nor anyone outside of immediate facilitation in advance of the Awards presentation night.'),(313,87,'_page_content','field_5c07f513ce381'),(366,103,'_edit_lock','1549014447:36'),(367,103,'_edit_last','36'),(378,70,'page_intro','By entering into the Awards of Excellence hosted by the Swimming Pool &amp; Spa Association of Australia (“SPASA”) you warrant that the details of your entry are correct in every respect and comply with the conditions of entry as set out below:'),(379,70,'_page_intro','field_5c07f58463562'),(380,70,'page_content','<ol>\r\n 	<li>Nominations for the Awards of Excellence (“Entries”), including the nomination form (“the Entry Form”), all images being relied on for the Entries (“Images”) and payments of the entry fees, must be received by the nomination deadline stated on the Entry Form (“Nomination Deadline”). Entry fees are strictly non-refundable.</li>\r\n 	<li>Entries can only be lodged online and will only be accepted from current financial members of SPASA (“Members”) and the subjects of all Entries (“the Entrants”) must be Members.</li>\r\n 	<li>Members can only submit Entries for categories of the Awards of Excellence that are relevant to their specific membership category.</li>\r\n 	<li>All Entries must comply with relevant industry and/or Australian Standards, all federal and state legislation and regulations, Australian copyright law and the Australian Consumer Law and its state equivalents where applicable.</li>\r\n 	<li>Members must obtain consent from all relevant parties to submit Entries and use the Images and may be asked to provide such consent to SPASA upon request. By making Entries, Members give consent to SPASA to use the Images and other documentation comprising the Entries for any promotional use SPASA sees fit.</li>\r\n 	<li>Where a Member has designed or built a pool or spa in conjunction with an Architect, Designer or Builder, the name of that company or individual must be acknowledged on the Entry Form.</li>\r\n 	<li>Any professional photographers used to capture images of build/installation projects for members entries, must be acknowledged on the Entry Form.</li>\r\n 	<li>Projects submitted for the Awards of Excellence (“Nominated Projects”) must have been built, installed or renovated by the Entrant under the Entrant’s current licence.</li>\r\n 	<li>Nominated Projects can only be submitted if the Entrant was involved from the start of the project. Entrants must be appropriately licensed or registered to carry out the Nominated Projects (as required by law) at the commencement and completion of the Nominated Project.</li>\r\n 	<li>Sufficient supporting details and photos must accompany the Entries to enable SPASA and the judges for the Awards of Excellence (“the Judges”) to be satisfied that the Entry lodged does qualify for the category entered.</li>\r\n 	<li>Entries for the Build/Installation categories must have been completed within three years of the Nomination Deadline, except for Display Pool/Centre.</li>\r\n 	<li>Entries into the Product/Industry categories must have been released or implemented after the 1st July 2017.</li>\r\n 	<li>Entries that have previously won a Gold award in the Build/Installation and Product/Industry categories cannot be re-entered into that same category.</li>\r\n 	<li>Nominated Projects may be submitted into multiple categories; however, every Entry will incur additional entry fees. All supporting documentation must accompany each Entry, including testimonials, references and additional information.</li>\r\n 	<li>SPASA reserves the right to disqualify an Entry before, during or after the Awards of Excellence without a refund, if deemed necessary.</li>\r\n 	<li>If a Nominated Project is entered into an ineligible category, SPASA reserves the right to move the Nominated Project to a more appropriate category.</li>\r\n 	<li>One high resolution digital primary image must be supplied with each Entry. Images should be no less than 300dpi and 3MB in size for best quality. Build/Installation categories must not contain any information which identifies the Entrant.</li>\r\n 	<li>A maximum of five (5) supporting images are admissible with each Entry, to highlight different angles, unusual site conditions or features, etc.</li>\r\n 	<li>Entries into the renovation categories must be accompanied with before and after images from the same perspective angle.</li>\r\n 	<li>Entrants acknowledge that SPASA takes no responsibility for the quality of Images nor any editorial discrepancies attached to any Image.</li>\r\n 	<li>Only winners of a category at the Awards of Excellence may advertise the winning of an award. All advertising/promotional material used by the Member advertising an Award must show the year the Award was won and category of the Award.</li>\r\n 	<li>Awards are not transferable</li>\r\n 	<li>Judges’ decisions regarding Awards given will be final and no correspondence will be entered into.</li>\r\n 	<li> Only Gold winners of regional Awards will be eligible for the National Awards competition.</li>\r\n 	<li>Words in these Terms denoting the singular number only include the plural number and vice versa.</li>\r\n</ol>'),(381,70,'_page_content','field_5c07f513ce381'),(398,68,'page_intro','Below you will find a a collection of award entries for you to judge upon. Please review each entry and complete your scores before the award deadline. Eligibility for each category is outlined in our <a href=\"http://spasa.local/wp-content/uploads/Judging-Criteria.pdf\" target=\"_blank\" rel=\"noopener\">Judging Criteria</a> and <a href=\"http://spasa.local/terms-conditions/\">Terms &amp; Conditions</a>.'),(399,68,'_page_intro','field_5c0aad2f52420'),(400,68,'page_content',''),(401,68,'_page_content','field_5c07f513ce381'),(406,65,'page_intro',''),(407,65,'_page_intro','field_5c07f58463562'),(408,65,'page_content',''),(409,65,'_page_content','field_5c07f513ce381'),(414,127,'_edit_lock','1547113007:36'),(415,127,'_edit_last','36'),(418,8,'intro_paragraph',''),(419,8,'_intro_paragraph','field_5c086dbe3cb03'),(420,8,'background_image',''),(421,8,'_background_image','field_5c086e0d3cb04'),(433,8,'hero_paragraph','The SPASA Awards of Excellence recognise the best in the Pool and Spa industry'),(434,8,'_hero_paragraph','field_5c086dbe3cb03'),(435,8,'hero_background','132'),(436,8,'_hero_background','field_5c086e0d3cb04'),(445,8,'hero_title','Awards of Excellence'),(446,8,'_hero_title','field_5c0923ddbd7d9'),(457,8,'intro_text','<h2>What are the SPASA Awards of Excellence?</h2>\r\nThe SPASA Awards of Excellence celebrate the outstanding achievements of members across all sectors and offer the opportunity to showcase accomplishments in construction, design, manufacturing and service.'),(458,8,'_intro_text','field_5c09245f6df1f'),(459,8,'column_1','<h3>Who can enter?</h3>\r\nThe Awards of Excellence is available exclusively to SPASA members.\r\n\r\nSPASA members are eligible to enter the Awards in a wide range of categories representing all sectors.\r\n<ul>\r\n 	<li>Industry/Product</li>\r\n 	<li>Build/Installation</li>\r\n 	<li>Company/Business</li>\r\n 	<li>Individual/Employee</li>\r\n</ul>\r\nGold winners of Regional Awards will be eligible for the National Awards competition.'),(460,8,'_column_1','field_5c09249d6df20'),(461,8,'column_2','<h3>Why you should enter</h3>\r\nThe Awards are held to provide you with valuable business and marketing opportunities! Receive exposure amongst industry peers on the night, in your Regional SPASA magazine, Trade magazines, social media and more. This coverage will allow you to leverage your company’s success through publicity and brand exposure.\r\n\r\nThese Awards are eagerly sought after by members who recognise the value to consumers by showcasing their achievements. By entering the Awards, you’re not only setting leadership standards by example, you’re injecting consumers with confidence in dealing with winning SPASA members.'),(462,8,'_column_2','field_5c0924c56df21'),(463,8,'column_3','<h3>How it works</h3>\r\n<img class=\"alignright\" src=\"/wp-content/uploads/fast.png\" alt=\"Fast\" width=\"156\" height=\"156\" />Simple to use, with fast access, means you can enter an award anytime, anywhere.\r\n\r\n<hr />\r\n\r\n<img class=\"alignright\" src=\"/wp-content/uploads/secure.png\" alt=\"Secure\" width=\"156\" height=\"156\" />Your entries are secure, with the ability to save partially completed submissions, offering you flexibility to start and to finish your nominations when you want.\r\n\r\n<hr />\r\n\r\n<img class=\"alignright\" src=\"/wp-content/uploads/copy.png\" alt=\"Copy\" width=\"156\" height=\"156\" />Save time, when entering more than one category, by copying information from previous entry forms.'),(464,8,'_column_3','field_5c0924e46df22'),(489,150,'_wp_attached_file','copy.png'),(490,150,'_wp_attachment_metadata','a:5:{s:5:\"width\";i:156;s:6:\"height\";i:156;s:4:\"file\";s:8:\"copy.png\";s:5:\"sizes\";a:1:{s:9:\"thumbnail\";a:4:{s:4:\"file\";s:16:\"copy-150x150.png\";s:5:\"width\";i:150;s:6:\"height\";i:150;s:9:\"mime-type\";s:9:\"image/png\";}}s:10:\"image_meta\";a:12:{s:8:\"aperture\";s:1:\"0\";s:6:\"credit\";s:0:\"\";s:6:\"camera\";s:0:\"\";s:7:\"caption\";s:0:\"\";s:17:\"created_timestamp\";s:1:\"0\";s:9:\"copyright\";s:0:\"\";s:12:\"focal_length\";s:1:\"0\";s:3:\"iso\";s:1:\"0\";s:13:\"shutter_speed\";s:1:\"0\";s:5:\"title\";s:0:\"\";s:11:\"orientation\";s:1:\"0\";s:8:\"keywords\";a:0:{}}}'),(491,151,'_wp_attached_file','secure.png'),(492,151,'_wp_attachment_metadata','a:5:{s:5:\"width\";i:156;s:6:\"height\";i:156;s:4:\"file\";s:10:\"secure.png\";s:5:\"sizes\";a:1:{s:9:\"thumbnail\";a:4:{s:4:\"file\";s:18:\"secure-150x150.png\";s:5:\"width\";i:150;s:6:\"height\";i:150;s:9:\"mime-type\";s:9:\"image/png\";}}s:10:\"image_meta\";a:12:{s:8:\"aperture\";s:1:\"0\";s:6:\"credit\";s:0:\"\";s:6:\"camera\";s:0:\"\";s:7:\"caption\";s:0:\"\";s:17:\"created_timestamp\";s:1:\"0\";s:9:\"copyright\";s:0:\"\";s:12:\"focal_length\";s:1:\"0\";s:3:\"iso\";s:1:\"0\";s:13:\"shutter_speed\";s:1:\"0\";s:5:\"title\";s:0:\"\";s:11:\"orientation\";s:1:\"0