ategory is outlined in our <a href=\"http://spasa.local/wp-content/uploads/pdf/Judging-Criteria.pdf\" target=\"_blank\" rel=\"noopener\">Judging Criteria</a> and <a href=\"http://spasa.local/terms-conditions/\">Terms &amp; Conditions</a>. Gold winners of Regional Awards will be eligible for the National Awards competition.'),(601,75,'_page_intro','field_5c07f58463562'),(602,75,'page_content',''),(603,75,'_page_content','field_5c07f513ce381'),(604,75,'hide_from_search_engines','no'),(605,75,'_hide_from_search_engines','field_5c0958416252e'),(612,190,'_edit_lock','1544365571:1'),(613,190,'_edit_last','1'),(614,75,'faqs_0_question','What are the rules of entry?'),(615,75,'_faqs_0_question','field_5c0d1dad44580'),(616,75,'faqs_0_answer','Please refer to the <a href=\"http://spasa.local/terms-conditions/\">Terms &amp; Conditions here</a>.'),(617,75,'_faqs_0_answer','field_5c0d1dbb44581'),(618,75,'faqs_1_question','Who is eligible to enter?'),(619,75,'_faqs_1_question','field_5c0d1dad44580'),(620,75,'faqs_1_answer','The Awards of Excellence is available exclusively to SPASA members.\r\n\r\nEligibility for each category is outlined <a href=\"http://spasa.local/wp-content/uploads/pdf/Judging-Criteria.pdf\" target=\"_blank\" rel=\"noopener\">here</a> and in the <a href=\"http://spasa.local/terms-conditions/\">Terms &amp; Conditions</a>.\r\n\r\nGold winners of Regional Awards will be eligible for the National Awards competition.'),(621,75,'_faqs_1_answer','field_5c0d1dbb44581'),(622,75,'faqs_2_question','How do I submit an entry?'),(623,75,'_faqs_2_question','field_5c0d1dad44580'),(624,75,'faqs_2_answer','You must submit your entry/entries via this website, which will be open for submissions until April 15th 2019.\r\n\r\nFollow the steps below to submit an entry:\r\n<ol>\r\n 	<li>If you haven’t already, <a href=\"http://spasa.local/register/\">register here</a></li>\r\n 	<li>If you have already registered, <a href=\"http://spasa.local/login/\">log in</a> with your username &amp; password</li>\r\n 	<li>Ensure you have read the <a href=\"http://spasa.local/terms-conditions/\">Terms &amp; Conditions</a> for the Awards of Excellence 2019</li>\r\n 	<li>Click on \"Submit New Entry\"</li>\r\n 	<li>Select a category</li>\r\n 	<li>Complete your entry for your selected category</li>\r\n 	<li>Either select \"Draft\" or \"Complete\" at the bottom of the page</li>\r\n 	<li>Entries marked with \"Complete\" will then be required to make payment</li>\r\n</ol>\r\nWe strongly recommend that you start to prepare your submission early, and do not leave it to the last moment to upload your entry.\r\n\r\nTo be fair to all nominees in the Awards of Excellence we cannot provide advice or suggestions on any entries.'),(625,75,'_faqs_2_answer','field_5c0d1dbb44581'),(626,75,'faqs_3_question','I’ve saved an entry, how do I edit it?'),(627,75,'_faqs_3_question','field_5c0d1dad44580'),(628,75,'faqs_3_answer','<ol>\r\n 	<li><a href=\"http://spasa.local/login/\">Log in</a> with your username &amp; password</li>\r\n 	<li>Click on \"Admin\" from the top menu</li>\r\n 	<li>Select the entry you wish to edit</li>\r\n 	<li>Either select \"Draft\" or \"Complete\" at the bottom of the page</li>\r\n 	<li>Entries marked with \"Complete\" will then be required to make payment</li>\r\n</ol>'),(629,75,'_faqs_3_answer','field_5c0d1dbb44581'),(630,75,'faqs_4_question','What does it cost to enter?'),(631,75,'_faqs_4_question','field_5c0d1dad44580'),(632,75,'faqs_4_answer','<ul>\r\n 	<li>Your first entry is $250 with every entry thereafter at $150</li>\r\n 	<li>Entries into Individual/Employee Categories are $100</li>\r\n 	<li>Categories 46 &amp; 47 are $500 to enter</li>\r\n</ul>\r\nAll prices include GST\r\n\r\nProjects may be submitted into multiple categories; however, every category entry must be accompanied by additional fees.\r\n\r\nPayment must be made before the nomination deadline for your entry to be eligible for judging'),(633,75,'_faqs_4_answer','field_5c0d1dbb44581'),(634,75,'faqs_5_question','How many awards can I enter?'),(635,75,'_faqs_5_question','field_5c0d1dad44580'),(636,75,'faqs_5_answer','As many as you like! The more you enter, the better chance you have of winning!'),(637,75,'_faqs_5_answer','field_5c0d1dbb44581'),(638,75,'faqs_6_question','Can I re-enter categories I\'ve won in previous years?'),(639,75,'_faqs_6_question','field_5c0d1dad44580'),(640,75,'faqs_6_answer','Yes, you can! Entries that have won Silver or Bronze in any category can be re-entered.\r\n\r\nIf you have won a Gold Award you cannot re-enter, however some exceptions apply. Refer to the <a href=\"http://spasa.local/terms-conditions/\">Term’s &amp; Conditions</a> for more information.'),(641,75,'_faqs_6_answer','field_5c0d1dbb44581'),(642,75,'faqs_7_question','How does the judging work?'),(643,75,'_faqs_7_question','field_5c0d1dad44580'),(644,75,'faqs_7_answer','Once the awards portal closes for submissions, all entries will be available to view on the SPASA Nominations Website on a designated date prior to judging. This viewing provides members with an opportunity to inspect entries as well as lodge an objection or raise concerns regarding entries.\r\n\r\nAll entries will then be assessed by a panel of judges, comprising of representatives from various industry associated third parties. The Awards Judging Facilitator will oversee the judging process and ensure impartiality.\r\n\r\nEntries are judged based on <a href=\"http://spasa.local/wp-content/uploads/pdf/Judging-Criteria.pdf\" target=\"_blank\" rel=\"noopener\">criteria set out for each category</a> and will be scored out of 100 with the three highest scores being awarded Gold or Highly Recommended. The judges may also award a ‘Merit’ Award if applicable.\r\n\r\nIn the event of a tie, the judges may confer to determine a result.\r\n\r\nJudges will deliberate via teleconference or other means as appropriate to determine Pool of the Year, Spa of the Year, Retailer of the Year and Commercial Project of the Year.\r\n\r\nNo information in relation to winners or entrants is made available to the SPASA Board, local committees nor anyone outside of immediate facilitation in advance of the Awards presentation night.'),(645,75,'_faqs_7_answer','field_5c0d1dbb44581'),(646,75,'faqs_8_question','I still have questions, who can I ask?'),(647,75,'_faqs_8_question','field_5c0d1dad44580'),(648,75,'faqs_8_answer','If you have a query about your eligibility or rules of the competition, please contact us at <a href=\"mailto:members@spasa.com.au\">members@spasa.com.au</a> or call 1300 021 482. We will endeavor to respond within 48 hours.'),(649,75,'_faqs_8_answer','field_5c0d1dbb44581'),(650,75,'faqs','9'),(651,75,'_faqs','field_5c0d1d904457f'),(999,206,'_edit_lock','1546174932:1'),(1000,206,'_edit_last','1'),(1018,212,'_edit_lock','1548419154:36'),(1019,212,'_edit_last','36'),(1020,212,'_wp_page_template','pages/awards.php'),(1021,212,'page_intro','Projects may be submitted into multiple categories; however, every category entry must be accompanied by additional fees. Payment must be made before the nomination deadline for your entry to be eligible for judging.'),(1022,212,'_page_intro','field_5c07f58463562'),(1023,212,'page_content','<h2>Awards Entry Costs</h2>\r\n<ul>\r\n 	<li>Your first entry is $250 with every entry thereafter at $150</li>\r\n 	<li>Entries into Individual/Employee Categories are $100</li>\r\n 	<li>Categories 46 &amp; 47 are $500 to enter</li>\r\n</ul>\r\nAll prices include GST'),(1024,212,'_page_content','field_5c07f513ce381'),(1025,212,'hide_from_search_engines','no'),(1026,212,'_hide_from_search_engines','field_5c0958416252e'),(1027,212,'events_0_title','Nomination Deadline'),(1028,212,'_events_0_title','field_5c0e3a5b77d29'),(1029,212,'events_0_start_date','20190415'),(1030,212,'_events_0_start_date','field_5c0e3ca465e94'),(1031,212,'events','7'),(1032,212,'_events','field_5c0e3a4577d28'),(1033,212,'events_0_end_date',''),(1034,212,'_events_0_end_date',